import React from 'react';
import '../styles/App.css';

function App() {
  return (
    <div className="App">
      <button className="App-add-task-button">Add task</button>
      <button className="App-tasks">Tasks</button>
      <button className="App-tasks">New Task</button>
      <button className="App-tasks">Old Tasks</button>
      <button className="App-tasks">Complete</button>
    </div>
  );
}

export default App;
